import React, { Component } from 'react';
import Head from 'next/head';
import SideMenu from '../SideMenu';
import Header from '../Header.js';
export default class mainSite extends Component {
	constructor(props) {
		super(props);
		this.state = { hamburger: false, pooped: false };
	}
	toggleHamburger = () => {
		this.setState({ hamburger: !this.state.hamburger });
	};
	render() {
		let trigger = this.state.hamburger && this.state.pooped ? 'outer-containerOpen' : '';
		let containerWrapper = `container outer-container ${trigger}`;
		return (
			<div className={containerWrapper}>
				<Head>
					<link href="/styles.css" rel="stylesheet" />
					<title>Cancelled Toronto</title>
				</Head>
				<Header toggleHamburger={this.toggleHamburger} activeHam={this.state.hamburger} />
				<SideMenu toggleHamburger={this.toggleHamburger} open={this.state.hamburger} />
				<div
					onClick={() => {
						console.log(this.state.pooped);
						this.setState({ pooped: !this.state.pooped });
					}}
				>
					Hi Danny, Click me to change the hamburger style <br />Current Style:{this.state.pooped ? '1' : '2'}
				</div>
				{this.props.children}
			</div>
		);
	}
}
